  const handleClick = () => {
    console.log("button clicked");
  };
  return (
    <div>
      Welcome to my App: {props.person?.name}
      <h2>First Name : {props.person?.name}</h2>
      <h3>Last Name: {props.person?.lastName}</h3>
      <button> onClick={handleClick}Click Me</button>
    </div>
  );
}
